    R_LC_Lan_Fin.prototype.ImprimirAberturaTermo = function () {
        try {
            var data = this.txtDataAbertura.Date.getDate() + " de " + this.txtDataAbertura.Date.GetMesExtenso() + " de " + this.txtDataAbertura.Date.getFullYear();
            var parametros = {
                livro: this.txtLivroAbertura.GetText().CNum(),
                dataAbertura: data,
                empresa: this.cboEmpresa.GetValue()
            };
            var retorno = this.ExecutarFuncaoServerSideSynch("PrepararImpressaoTerAber", parametros);
            if (!String.IsNullOrWhiteSpace(retorno)) {
                MostrarAlerta(retorno);
            }
            else {
                AbrirReport("~/Report/Fixos/", "TermoAberFec.REPX");
            }
        }
        catch (ex) {
            LogarException(ex);
        }
    };
