    R_LC_Lan_Fin.prototype.GerarLancamento = function () {
        var _this = this;
        debugger;
        var parametros;
        try {
            if (this.cboContaCorrente.Combo.GetText() == "") {
                MostrarAlerta("Informe a conta corrente");
                return false;
            }
            if (this.cboAno.GetValue() <= 0) {
                MostrarAlerta("Informe o ano");
                return false;
            }
            if (this.cboMes.GetValue() <= 0) {
                MostrarAlerta("Informe o mês");
                return false;
            }
            if (this.cboEmpresa.GetValue() <= 0) {
                MostrarAlerta("Informe a empresa");
                return false;
            }
            if (String.IsNullOrWhiteSpace(this.txtFolhaLan.GetText()) || this.txtFolhaLan.GetText() == "0") {
                MostrarAlerta("Informe o Nº da folha");
                return false;
            }
            var contaCorrente = this.cboContaCorrente.Combo.GetText() == "--Todos--" ? 0 : this.cboContaCorrente.GetContaCorrente();
            parametros = {
                contaCorrente: contaCorrente,
                mes: this.cboMes.GetValue(),
                ano: this.cboAno.GetValue(),
                empresa: this.cboEmpresa.GetValue()
            };
            abrirEspera();
            this.ExecutarFuncaoServerSideAsynch("PreencherGridLancamento", parametros, function (d) {
                fecharEspera();
                var retorno = GetRetornoAJAX(d);
                _this.grid.PreencherGrid(retorno);
            }, function (erro) {
                fecharEspera();
                LogarException(erro);
            }, this);
        }
        catch (ex) {
            fecharEspera();
            LogarException(ex);
        }
    };
